import React from "react";
import "../styles/pages/approach.scss";


const tiles = [
  {title:"Business Inquiry",image:"For development"},
  {title:"For development, cooperation, and for guest inquiries",image:"https://www.tissotwatches.com/media/shop/catalog/product/cache/all/image/920x/17f82f742ffe127f42dca9de82fb58b1/T/1/T106.417.16.201.01_1.png"},
];



const Approach = () => {
  return (
    <div>
    <section className='main'>
      <div className='container'>
        <div className='row'>
          <h2>
            <div className='line'>
              <span>Get in touch with us</span>
            </div>
          </h2>
        </div>
      </div>
    </section>

    <div className="responsiveGrid">
         {
            tiles.map((tile)=>
                 <div className="tileData">
                  <div className="tile">
                    <div className="title">{tile.title}</div>
                    <div className="image">
                      {tile.image}
                    </div>
                  </div>
                </div>
            )
          }
      </div>
    </div>
  );
};

export default Approach;
